GTraductions.add("AbsenceVS.MFicheFeuilleAppelVS", '{"titre":"Fonctionnement de la feuille \\\"Appel et suivi\\\" ?","html":{"_T":23,"V":"<div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><strong>Personnalisation des</strong> <strong>rubriques</strong></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Vous pouvez choisir d\'ajouter des rubriques facultatives dans la fen&ecirc;tre de param&egrave;tres <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />.</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><strong>Lien avec la vie scolaire<br /></strong>&agrave; droite du nom de l\'&eacute;l&egrave;ve, diff&eacute;rents icones vous renseignent<strong><br /></strong></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\"><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />&nbsp;:&nbsp;&nbsp;&nbsp; l\'&eacute;l&egrave;ve est convoqu&eacute; &agrave; la vie scolaire<br /><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />&nbsp;:&nbsp; l\'absence a &eacute;t&eacute; saisie par la vie scolaire<br /><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />&nbsp;: l\'&eacute;l&egrave;ve n\'est absent que sur une partie du cours&nbsp;<br /><img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />&nbsp;&nbsp;:&nbsp;&nbsp;&nbsp; l\'&eacute;l&egrave;ve &eacute;tait absent &agrave; l&rsquo;heure pr&eacute;c&eacute;dente (en rouge si l\'absence est non r&eacute;gl&eacute;e)</span></span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial;\\\"><br /><span style=\\\"color: #ff0000;\\\">Nom de l\'&eacute;l&egrave;ve en rouge</span> : Il &eacute;tait absent&nbsp;&agrave; votre&nbsp;dernier cours</span></span></div></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\"><strong>D&eacute;compte des &eacute;v&egrave;nements pass&eacute;s</strong></span></div><span style=\\\"font-family: Arial; font-size: 12px;\\\">Dans chaque colonne, PRONOTE d&eacute;compte le nombre d\'&eacute;v&egrave;nements que vous avez affect&eacute; &agrave; chaque &eacute;l&egrave;ve depuis la date d&eacute;finie en haut &agrave; droite. Un double clic sur ce nombre affiche le d&eacute;tail des &eacute;v&egrave;nements de l\'&eacute;l&egrave;ve ainsi que, si vous en avez l\'autorisation, les &eacute;v&egrave;nements de m&ecirc;me nature dans les autres mati&egrave;res.</span></div>"},"width":500,"height":280,"type":4,"boutons":{"_T":18,"V":1024}}');
GTraductions.add("AbsenceVS.MFicheFeuilleAppelVSSansCours", '{"titre":"Comment renseigner la feuille \\\"Appel et suivi\\\" ?","html":{"_T":23,"V":"<div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">1. Choisissez votre classe ou groupe et d&eacute;finissez le cr&eacute;neau horaire en choisssant les horaires dans le bandeau de titre.</span></div><div style=\\\"text-align: left; text-indent: 0px; font-family: Arial; font-size: 13px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 8px;\\\">&nbsp;</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">2. Dans chaque colonne cochez les &eacute;l&egrave;ves concern&eacute;s par l\'&eacute;v&egrave;nement.</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Vous pouvez choisir d\'ajouter des rubriques facultatives dans la fen&ecirc;tre accessible depuis le bouton <img src=\\\"data:image/png;base64,\\\" alt=\\\"\\\" />.</span></div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div style=\\\"text-align: left; text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Dans chaque colonne, PRONOTE d&eacute;compte le nombre d\'&eacute;v&egrave;nements que vous avez affect&eacute; &agrave; &nbsp;chaque &eacute;l&egrave;ve depuis la date d&eacute;finie en haut &agrave; droite. Un double clic sur ce nombre affiche le d&eacute;tail des &eacute;v&egrave;nements de l\'&eacute;l&egrave;ve ainsi que, si vous en avez l\'autorisation, les &eacute;v&egrave;nements de m&ecirc;me nature dans les autres mati&egrave;res.</span></div>"},"width":440,"height":175,"type":4,"boutons":{"_T":18,"V":1024}}');
