GTraductions.add("Notes.MFicheNotationSpecifique", '{"titre":" Comment indiquer une absence, une dispense ... ","html":{"_T":23,"V":"<div><span style=\\\"font-family: Arial; font-size: 12px;\\\">Les notes saisissables sont fonction du barme de chaque devoir.</span></div><div><span style=\\\"font-family: Arial; font-size: 12px;\\\">En revanche vous pouvez indiquer d\'autres tats en utilisant les caractres dsigns ci-dessous.</span></div><div style=\\\"text-indent: 0px; margin-left: 0px; font-size: 13px;\\\"><span style=\\\"font-family: Arial; font-size: 8px;\\\"> </span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Pour ne pas comptabiliser le devoir dans le calcul de la moyenne :</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">A</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> : L\'lve est Absent (Abs)</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span>D</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> : L\'lve est Dispens (Disp)</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">N</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> : L\'lve est Non not (N.Not)</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">I</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> :   L\'lve est Inapte (Inap)</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">R</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> : L\'lve n\'a pas Rendu son devoir (N.Rdu)</span></div><div style=\\\"text-indent: 0px; margin-left: 0px; font-size: 13px;\\\"><span style=\\\"font-family: Arial; font-size: 8px;\\\"> </span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">Pour  comptabiliser le devoir comme un 0 dans le calcul de la moyenne :</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">Z</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> :  L\'lve a une absence injustifie (Abs*)</span></div><div style=\\\"text-indent: 0px; margin-left: 0px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">        </span><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">W</span></strong><span style=\\\"font-family: Arial; font-size: 12px;\\\"> : L\'lve n\'a pas rendu son travail (N. Rdu*)</span></div>"},"width":440,"height":225,"type":4,"boutons":{"_T":18,"V":1024}}');
