GTraductions.add("FenetreDevoir.MFicheBaremeDifferentDe20", '{"titre":" Comment utiliser un barme diffrent du barme gnral ?","html":{"_T":23,"V":"<div style=\\\"text-indent: 0px; margin-left: 0px;\\\">&nbsp;</div><div><span style=\\\"font-family: Arial; font-size: 12px;\\\">Un devoir not&eacute; sur un bar&egrave;me de notation diff&eacute;rent du bar&egrave;me g&eacute;n&eacute;ral peut &ecirc;tre pris en compte de deux fa&ccedil;ons dans le calcul de la moyenne du service :</span></div><div style=\\\"font-size: 13px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">&nbsp;</span></div><div><span style=\\\"font-family: Arial; font-size: 12px;\\\">- Si vous cochez la case <span style=\\\"color: #888888;\\\"><em><strong>Ramener les notes sur 20 lors du calcul de la moyenne</strong></em></span>, PRONOTE ram&egrave;nera toutes les notes sur un bar&egrave;me de 20 avant de calculer la moyenne du service.</span></div><div style=\\\"font-size: 13px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">&nbsp;</span></div><div><span style=\\\"font-family: Arial; font-size: 12px;\\\">- Si vous ne cochez pas <span style=\\\"color: #888888;\\\"><em><strong>Ramener les notes sur 20 lors du calcul de la moyenne</strong></em></span>, chaque devoir sera pond&eacute;r&eacute; par son bar&egrave;me : ainsi un devoir sur 10 comptera dans la moyenne deux fois moins qu\'un devoir sur 20.</span></div><div style=\\\"font-size: 13px;\\\"><span style=\\\"font-family: Arial; font-size: 12px;\\\">&nbsp;</span></div><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">Exemple&nbsp;:</span><span style=\\\"font-size: 12px;\\\"><br />Vous avez trois notes, 18/20, 2/10 et 1/5.<br />Si vous cochez <span style=\\\"color: #888888;\\\"><strong>Ramener les notes sur 20</strong></span>, la moyenne sera&nbsp;:</span></em></span></div><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><table style=\\\"width: 367px; height: 47px;\\\" border=\\\"0\\\"><tbody><tr><td><div><span style=\\\"font-family: arial,helvetica,sans-serif;\\\">&nbsp;</span></div><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">&nbsp;&nbsp;&nbsp;</span><span style=\\\"text-decoration: underline;\\\"><span style=\\\"font-size: 12px;\\\">&nbsp;18 + 4 + 4 &nbsp;&nbsp;</span></span></em></span><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">&nbsp;&nbsp;&nbsp;20 + 20 + 20</span></em></span></div></td><td><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">X 20 = 8,67, soit une note de 8,67/20</span></em></span></td></tr></tbody></table></div><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">&nbsp;</span></em></span></div><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">Si vous ne cochez pas <span style=\\\"color: #888888;\\\"><strong>Ramener les notes sur 20</strong></span>, la moyenne sera&nbsp;:</span></em></span></div><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><table style=\\\"width: 370px; height: 47px;\\\" border=\\\"0\\\"><tbody><tr><td><div><span style=\\\"font-family: arial,helvetica,sans-serif;\\\">&nbsp;</span></div><div><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><em><span style=\\\"text-decoration: underline;\\\"><span style=\\\"font-size: 12px;\\\"><em><span style=\\\"font-size: 12px;\\\">&nbsp; &nbsp;</span><span style=\\\"text-decoration: underline;\\\"><span style=\\\"font-size: 12px;\\\">18 +2 +1&nbsp;&nbsp;&nbsp;</span></span><span style=\\\"font-size: 12px;\\\">&nbsp;</span></em></span></span></em></em></span></div><div><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">&nbsp; 20 + 10 + &nbsp;</span></em><span style=\\\"font-size: 12px;\\\">5</span></span></div></td><td><span style=\\\"font-family: arial,helvetica,sans-serif;\\\"><em><span style=\\\"font-size: 12px;\\\">X 20 = 12, soit une note de 12/20</span></em></span></td></tr></tbody></table></div><div style=\\\"line-height: 115%; margin-left: 0px; margin-right: 0px;\\\"><div style=\\\"line-height: 115%; margin-bottom: 13px;\\\"><span style=\\\"font-family: arial,helvetica,sans-serif; font-size: 14px;\\\">&nbsp;</span></div></div>"},"width":487,"height":350,"type":4,"boutons":{"_T":18,"V":1024}}');
GTraductions.add("FenetreDevoir.MFicheDevoirFacultatif", '{"titre":" Qu\'est ce qu\'un devoir facultatif ?","html":{"_T":23,"V":"<div>&nbsp;</div><div><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">M&eacute;thode 1 : Comme un bonus</span></strong></div><div style=\\\"font-size: 11px;\\\"><strong><span style=\\\"font-family: Arial; font-size: 10px;\\\">&nbsp;</span></strong></div><div><span style=\\\"font-family: Arial; font-size: 12px;\\\">Seuls les points sup&eacute;rieurs &agrave; 10 des devoirs facultatifs sont pris en compte dans le calcul de la moyenne du service ou sous-service.</span></div><div style=\\\"padding-left: 30px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Moyenne des devoirs non facultatifs (12+16) / 2 = 14</span></em></div><div style=\\\"padding-left: 30px;\\\"><span style=\\\"text-decoration: underline;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Exemple 1</span></em></span></div><div style=\\\"padding-left: 30px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Devoir facultatif : 17, Moyenne : (12+16+7) / 2 = 17,5</span></em></div><div style=\\\"padding-left: 30px;\\\"><span style=\\\"text-decoration: underline;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Exemple 2</span></em></span></div><div style=\\\"padding-left: 30px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Devoir facultatif : 8, Moyenne : (12+16+0) / 2 = 14</span></em></div><div style=\\\"font-size: 13px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">&nbsp;</span></em></div><div><strong><span style=\\\"font-family: Arial; font-size: 12px;\\\">M&eacute;thode 2 : Comme une note</span></strong></div><div style=\\\"font-size: 11px;\\\"><strong><span style=\\\"font-family: Arial; font-size: 10px;\\\">&nbsp;</span></strong></div><div><span style=\\\"font-family: Arial; font-size: 12px;\\\">Les devoirs facultatifs sont pris en compte, dans la moyenne du service ou sous-service, uniquement s\'ils am&eacute;liorent la moyenne de l\'&eacute;l&egrave;ve.</span></div><div style=\\\"padding-left: 30px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Moyenne des devoirs non facultatifs (12+16) / 2 = 14</span></em></div><div style=\\\"padding-left: 30px;\\\"><span style=\\\"text-decoration: underline;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Exemple 1</span></em></span></div><div style=\\\"padding-left: 30px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Devoir facultatif : 17, Moyenne : (12+16+17) / (2+1) = 15</span></em></div><div style=\\\"padding-left: 30px;\\\"><span style=\\\"text-decoration: underline;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Exemple 2</span></em></span></div><div style=\\\"padding-left: 30px;\\\"><em><span style=\\\"font-family: Arial; font-size: 12px;\\\">Devoir facultatif : 8, Moyenne : (12+16+0) / (2+0) = 14</span></em></div>"},"width":420,"height":297,"type":4,"boutons":{"_T":18,"V":1024}}');
